import React from 'react';

const Header = () => {
    return ( <header className="header">
    <div className="header__wrapper">
        <h1 className="header__title">
            <strong>I am <em>Pavel Radionov</em></strong><br></br>
        </h1>
        <h2 className="title-3">
            Junior .Net developer with 1 year experience in C# comercial development. I also have good theoretical knowledge base and bunch of my personal projects, which you can review on this website.
        </h2>
    </div>
</header>
);
}
 
export default Header;
